private void startWatching()
    {
        if (Directory.Exists(txtDirToWatch.Text))
        {
            Settings.Default["WatchDir"] = txtDirToWatch.Text;
            Settings.Default["WatchExt"] = txtWatchExt.Text;
            Settings.Default["PrintOnce"] = chkPrintOnce.Checked;

            Properties.Settings.Default.Save();

            fsWatcher = new FileSystemWatcher(txtDirToWatch.Text);

            fsWatcher.Created += new System.IO.FileSystemEventHandler(this.OnChanged);

            var withFSW = fsWatcher;
            withFSW.EnableRaisingEvents = true;
            withFSW.IncludeSubdirectories = false;

            withFSW.Filter = "RacunXML." + txtWatchExt.Text;

            this.BeginInvoke(new UpdateHistoryDel(addHistory), "Pratim: " + txtDirToWatch.Text + " za: " + withFSW.Filter);
        }
        else
        {
            this.BeginInvoke(new UpdateHistoryDel(addHistory), "Direktorij ne postoji!: " + txtDirToWatch.Text);
        }
    }

    public void OnChanged(object sender, FileSystemEventArgs e)
    {
        //print
     printFile(e.FullPath);
    }

    public void printFile(string fpath)
    {     
            XDocument doc;
            using (var reader = XmlReader.Create(fpath))                
            {
                doc = XDocument.Load(reader);

                foreach (var coordinate in doc.Descendants("Stavke"))
                {
                    string naziv = coordinate.Element("Naziv").Value;
                    string cijena = coordinate.Element("PRODCIJENA").Value;
                    this.BeginInvoke(new UpdateHistoryDel(addHistory), "1.000x     " + cijena + "     " + cijena + "E");
                    this.BeginInvoke(new UpdateHistoryDel(addHistory), naziv);
                }


            }  
        string sourceFile = "@"+""+fpath;
        System.IO.File.Delete(fpath);
    }

